window.bookSummaryJSON = "<p>\"What is the price you're willing to pay?\"</p> <p>\"Money isn't an issue.\"</p> <p>\"I'm not talking about money.\"</p> <p>Tate is on the hunt to find his best friend's sister. Eleven years ago, Lucia Dias was abducted. Presumed dead. He never met her, so why does he care? Some might call his efforts noble, but his motivation is more perverse, bordering on obsession.</p> <p>When he follows a chilling lead to Venezuela's Kidnap Alley, what he finds is neither a corpse nor a captive.</p> <p>Amid poisonous lies and crippling depravity, the price of love is devastation. And he pays.</p> <p>With his body, his blood, and her life. </p> <p>HEA with no cliff-hanger. Must be listened to in order.</p>"; 
